import React from 'react';
//import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function GoButton() {
  const [count, setCount] = useState(0);

  return (
    <div>
      <button onClick={() => setCount(count + 1)}>Go!</button>
      <br></br>
      <label>{count}</label>
    </div>
  );
}

function App() {
  return (
    <div>
      <GoButton />
    </div>
  );
}

export default App;
